import React from 'react';
import { Segment, Form,TextArea} from 'semantic-ui-react';


export default ()=>{
	return (
			<Segment>
			 <Button>Audit</Button>

			 <h4> Audit Report </h4>

			 <Form>
			 <TextArea style ={{height:'700px'}} placeholder="Paste your smart contract code here..."/>
			 </Form>
		 </Segment>
		)
}
